import { ButtonGroup, Button } from "react-bootstrap";

export default function ExampleGroup(props) {
    return (
        <ButtonGroup vertical className="special">
            {props.examples.map((e) => (
                <Button onClick={() => props.handleExample(e)} size="lg">
                    {e}
                </Button>
            ))}
        </ButtonGroup>
    );
}
